INSERT INTO `bots_pet_responses` VALUES ('pet.eating','*Saboreando*;*Comiendo*;Ahhh, un manjar;Ñam ñam, esto está buenísimo...'),('pet.givehanditem','¿y eso qué es?;*Comer*;¡Gracias!'),('pet.lazy','*bostezo*;*negarse*;*desobedecer*;¿Y quién eres tú?;Mejor hazlo tú primero;*risas*;¿Por qué yo?;Luego lo hago...;*no quiero*;Casi prefiero no hacerlo...'),('pet.refusehanditem','¿Me tratas de envenenar?;No gracias, paso.;Mejor no confío'),('pet.respected','¿Se puede pedir algo más?;*Feliz*;*Alegre*;Alegría, alegría'),('pet.sad','Hoy no es uno de mi días...;*triste*;Hoy no es un día feliz...;No tengo ánimos hoy;¿Hola? Necesito a alguien que me de compañia...;:(;¿Sabes? Quiero morir, no tengo ánimos para nada...;*demasiado triste*;Adiós, adiós, no hay objetivo aquí...;Quizás dormir para siempre sea lo mejor...'),('pet.tired','ZzZzzz;ZzzZz;*Cansado*;No;Necesito dormir una semana entera;Me comería incluso una ballena entera...;Me ruge el estómago'),('pet.unknowncommand','*Confundido*;*No entiendo*;¿Qué es eso?;???'),('pet16.respected','Era lo que necesitaba.;¡Hazlo otra vez!;¡Tú tienes el toque!;¡Gracias!'),('speech.pet0','*Olfatear*;Hoooooowl;¿Jugamos?;sit;snf;jmp;sitowner;std;std'),('speech.pet1','Miau;jmp;*A punto de desplomarse*;lay;lay;Me lo estoy pasando bomba;sit;snf;sitowner;std;std;sit'),('speech.pet10','Grrr;Pío Pío;sit'),('speech.pet11',';Bueno, ¿y si hacemos un buen chocolate?;lay;rlx;rlx;rlx'),('speech.pet12',';'),('speech.pet13','Horse;Goes;Neyyyy;'),('speech.pet14',';'),('speech.pet15','wag;kck;eyb;eat;std;std'),('speech.pet16','Aunque no te lo creas, solía sustituir a George Michael.;GWAR me ha ofrecido tocar el bajo, pero les he dicho que no tengo manos.;¿Sabes lo que me encantaría? ¡Tener piernas!;*Eructo*;*Pedo*;*Ronquido*;gst,lgh;gst,hpy;eyb;¡Oye, oye, oye!;gst,ywn;Oye, ¿cómo estás?'),('speech.pet16.die','¡Por fin ya podré dormir!;Hola colega, ¿me ibas a ayudar? es muy tarde...;*ahogo* Adiós mundo cruel....;¡Vaya! ¡Me he muerto!;¡Por fin podre dormir!;Soy el ultimo superviviente del tiesto y voy a desconectar.;¡Tu descuido me ha matado!;¡Me he muerto! ¿Un poco de ayuda, colega? ¡Haz lo de Lázaro!;Después de ver cómo te cortas las uñas de los pies, ¡No me da miedo morir! ¡Adiós!;¡Cúanto me alegro de verte por aquí!;Podemos decir que he muerto oficialmente.'),('speech.pet16.realive','¡He vuelto!;¿Me he perdido de algo?;Estaba durmiendo tranquilamente ¿sabes?'),('speech.pet16.todie','¡Oye! ¡Me estoy muriendo!;Pensaba que la muerte no dolería, pero duele muchísimo! ¡Sálvame la vida!;Si te estuvieras muriendo, te ayudaría.;Dile a las hermanas que pronto estaré en casa.;Espero que haya aeropatines en la otra vida.;En muchos aspectos, morir es lo peor que me ha pasado.;¡Atención, muerte, allá voy!;Me estoy muriendo. Me gustaría volver a ver mis amig@s: Timmy, Thomas y ese chico feo al que tiré desde el tejado... Todos me están esperando allí.;¿Esto es el fin? No morir con un estallido, sino con un lamento, ¡pobre de mí!;¡Oye! ¡Estoy luchando para que no se apague la luz!'),('speech.pet17','¡qué bonito día hace hoy!;*soñar*;*soñar que es una policia*;*mover la colita*;*escuchar*;Try everything;Dulces galletas con queso...;gst,sml;spk;slp;sitowner;sitowner;eyb'),('speech.pet18',';'),('speech.pet19',';'),('speech.pet2','*Soñar que se come al dueño*;Grrr.... No me toques.;Grrr;¿y tu qué?;Carne fresca...;snf;sit;'),('speech.pet20',';'),('speech.pet21',';'),('speech.pet22',';'),('speech.pet26',';'),('speech.pet28',';'),('speech.pet29',';'),('speech.pet3','woof woof woof!!!;hooooowl;wooooof!;Woof Woof!;sit;lay;snf;Woof;'),('speech.pet30','Grrr;'),('speech.pet4','*buscando salmón fresco*;Rawrrr!;*sniff sniff*;Yawnnnn..;Rawr! ... Rawrrrrr?;snf;'),('speech.pet5','Oink;Oink Oink;*Olfatear*;*Revolcarse*;'),('speech.pet6','Grrr;'),('speech.pet7','Grrr;'),('speech.pet8','Grrr;'),('speech.pet9','Tongo tongo, le tongue;Soy mucho más rapido que todos los demás;*Relajado*;'),('welcome.speech.0','¡Has llegado!'),('welcome.speech.pet0','Eres tan especial...'),('welcome.speech.pet1','*Rugiendo de amor por {0}*'),('welcome.speech.pet10','¡Por fin has llegado {0}!'),('welcome.speech.pet11','Hola colega.;¿Qué hay colega?'),('welcome.speech.pet15','Eres tan especial...'),('welcome.speech.pet16','¡Chu, Chu!;¿Qué pasa?;Vaya, mira quién ha llegado...;¿Qué hay de nuevo {0}?;Eres tan especial...;Vaya, ¡parece que alguien le ha atropellado un autobús esta mañana! Es broma, estás bien.'),('welcome.speech.pet17','¡me alegra que hayas vuelto {0}!'),('welcome.speech.pet2','Hasta que has llegado {0}.'),('welcome.speech.pet26',';');

