INSERT INTO `catalog_pages` VALUES (1,-1,'Portada',9995,'1','1',1,0,1,'','frontpage4','catalog_decorative_header_dyn|','<i><b><font color=\"#0E668C\" size=\"16\">¡Bienvenid@ al Catálogo de Habbo 100% Actualizado</font></b></i><br><br>El HC Club es gratuito, aprovecha la oportunidad de comprar furnis con créditos totalmente gratis de la manera que más te guste. Explora y crea salas geniales para que tu experiencia sea mucho mejor. ¡Navega por nuestra tienda.<br><br><li>Ír a la <a href=\"event:catalog/open/habbo_club\"> Tienda HC</a></li><li><a href=\"event:catalog/open/set_pixelnew\"> Decora </a>tus Salas</li><li> Adopta<a href=\"event:catalog/open/Tienda de mascotas\"> una Mascota</a> o un <a href=\"event:catalog/open/bots\">BOT</a></li><li>Crea salas con<a href=\"event:catalog/open/category_wired\"> Wired</a></li><li>Cotiza en el <a href=\"event:catalog/open/marketplace_offers\"> Mercadillo</a></li><br><i><b><font color=\"#0E668C\" size=\"16\">Ã‚Â¿DÃƒÂ³nde puedo obtener Diamantes?</font></b></i><br><br>Tenemos un par de mÃƒÂ©todos de pago como tarjetas de crÃƒÂ©dito y PayPal que le permiten comprar créditos en nuestra tienda web.<br><br><a href=\"https://easybuy.pw/packages/currency\" target=\"_new\">Visita nuestra página de divisas para obtener mÃƒÂ¡s informaciÃƒÂ³n.</a>|Canjea tu código voucher aquí:'),(5,1004,'Furni HC',9997,'1','0',1,0,4,'habbo_club','default_3x3','clubcat_pic|clubcat_pic|clubcat_pic|clubcat_pic','|'),(6,1004,'Cátalogo para GM',3009,'0','0',9,0,30,'','default_3x3','vipheader1|vipteaser2','|'),(7,5,'Furni HC',172,'0','1',1,0,4,'','default_3x3','habboclub|catalog_hc_teaser','|'),(8,5,'HC Clásico',214,'1','1',1,0,1,'','default_3x3','catalog_header_hc|hc_catalog_teaser','Los Furni mas buscados y solo para miembros HabboID Club se encuentran aquí­. ¿Los vas a dejar escapar?! Unete al HabboID Club.|'),(9,2007,'Bots',65,'1','1',1,0,0,'bots','bots','catalog_bots_headline1_en|catalog_bots_headline1_en','¡Compra tu Propio Bot, Pueden hablar, caminar y da