oom_name_length_short','¡El nombre de la sala es muy corto!'),('room_rights_has_rights_error','¡El usuario ya tiene permisos!'),('shutdown_alert','<b>Cerrando el servidor</b>\r\nEl servidor se está cerrando. Si no quieres perder cambios, no hagas nada hasta que se termine.\r\n\r\n- El Equipo Staff'),('trade_failed','Error de tradeo'),('user_not_found','No se encontró ese usuario'),('welcome_bot_bye','@rojo@¡Buena suerte {0}!'),('welcome_bot_clonedetected','@rojo@¡Qué mala suerte! Los regalos se han acabado.'),('welcome_bot_gender_f','@rojo@¡Hola {0}, <b>Bienvenida</b>! Soy Luang, el recepcionista de Labbo, antes de entrar al Hotel te diré algunas cosas básicas ;)'),('welcome_bot_gender_m','@rojo@¡Hola {0}, <b>Bienvenido</b>! Soy Luang, el recepcionista de Labbo, antes de entrar al Hotel te diré algunas cosas básicas ;)'),('welcome_bot_string_2','@rojo@Los créditos son gratis, al igual que los píxeles. Sólo necesitas estar conectad@ para recibir más.'),('welcome_bot_string_3','@rojo@Al terminar aquí irás al recibidor, puedes encontrar a un Staff allí por si tienes dudas.'),('welcome_bot_string_4','@rojo@Puedes ver tu lista de comandos escribiendo  \':comandos\' en la barra de chat. Te recomiendo verlos.'),('welcome_bot_string_5','@rojo@Bueno, eso es todo lo que quería decirte. ¡Espero que la pases genial aquí!'),('welcome_bot_welcome','@rojo@¡Bien! Ahora pasa por aquí para hacer el check-in'),('welcome_command_1','¡Buenas {0}! Bienvenid@ a HabboID. Si necesitas ayuda o tienes dudas, solo pulsa la \'L\' en el menú superior :D'),('welcome_command_2','¡Hola {0}! Bienvenid@ a HabboID. ¡Disfruta de tu estancia! Si tienes dudas sobre algo pregúntame y te atenderé. º'),('welcome_command_3','¡Hola {0}! Bienvenid@ a HabboID. Disfruta tu estancia en el Hotel. Si tienes dudas, no olvides en preguntarme, te atenderé.');

