# Procedure "tools_createwhile"
#

DROP PROCEDURE IF EXISTS `tools_createwhile`;
CREATE PROCEDURE `tools_createwhile`()
BEGIN
    DECLARE i int DEFAULT 0;
    WHILE i <= 56 DO
        INSERT INTO catalog_items VALUES ();
        SET i = i + 1;
    END WHILE;
END;
